import React, { Fragment } from 'react'
import AddRestaurant from '../components/AddRestaurant'
import Header from '../components/Header'

const Home = () => {
    return (
        <Fragment>
            <Header/>
            <AddRestaurant/>
            
        </Fragment>
    )
}

export default Home;
